import './style.css';
import 'bootstrap/dist/css/bootstrap.css'



export default class Sign extends React.Component{
    render(){
        return (
            <div>
        <div className="signDiv1">
            

            <div className="signCon2">
            
            <form>
                <label className="lbl">SIGN UP</label>
                <input type="text" placeholder="Company Name" className="form-control" required ></input><br/>
                <input type="text" placeholder="First Name" className="form-control" required></input><br/>
                <input type="text" placeholder="Last Name" className="form-control" required></input>
                <input type="button" value="Submit" className="fname1"></input>
            </form>
            
                
                
            </div>
        </div>
        </div>
        
        );
    }
}
